import { Link } from 'react-router-dom'
import { useGlobal } from 'reactn'
import LogoutButton from './LogoutButton'

const Home = () => {
  return (
    <nav>
      {!user && <>
        <Link to="/signup">Signup</Link>
        <Link to="/login">Login</Link>
      </>}
      {user && <LogoutButton to="/">Logout</LogoutButton>}
    </nav>
  )
}

export default Home
